'''Ashuelot Reis''' is a nature spirit guarding the entrance to [[Nex]]. She is first met when players open the [[frozen door]] with the [[Frozen key (The Frozen Door)|frozen key]] and enter the [[Ancient Prison]] beneath the [[God Wars Dungeon]].

==History==
During the [[God Wars]], Ashuelot Reis, a [[Saradomin]]ist priest, was fighting for her god at the Temple of Lost Ancients, known today as the [[God Wars Dungeon]].{{CiteNPC|npc=Ashuelot Reis|quote=Later in the war, a great battle broke out in the Temple of Lost Ancients. I was a Saradominist soldier at the time, and I was among those who fought for him in that battle.}} One day, she and her fellow priests were approached by one of their own, who knew that his fellow priests had grown weary from the endless fighting, and revealed to them that he had secretly converted to [[Guthix]]ian teachings.{{CiteNPC|npc=Ashuelot Reis|quote=...many of us had grown tired of war. One of our priests discovered this. He came to us and revealed that he felt the same way, and that he had secretly converted to Guthix.}} Encouraging his fellow priests to join him, they abandoned the cause of Saradomin and became followers of Guthix.{{CiteNPC|npc=Ashuelot Reis|quote=He encouraged us to join him. We abandoned the cause of Saradomin and became followers of Guthix.}}

Their new leader, the former Saradomin priest who'd converted them, taught them the druidic ways of Guthix, including an ancient ritual that had the power to awaken Guthix himself, who they believed could put an end to the God Wars.{{CiteNPC|npc=Ashuelot Reis|quote=Our new leader taught us the ways of the druids, including an ancient ritual that had the power to awaken Guthix himself. We believed this ritual to be the only way to end the war.}} However, upon performing the ritual, it was discovered that it actually woke Nex rather than Guthix, and that the enchantments that sealed the Ancient Prison were destroyed in the process, releasing Nex and her army.{{CiteNPC|npc=Ashuelot Reis|quote=When our leader led us to perform the ritual, it was not Guthix we woke, but Nex and her forces. The ritual also destroyed the protective enchantments on their prison.}} Their leader, who had tricked the priests into freeing Nex, was revealed to be [[Sliske]], a Zarosian [[Mahjarrat]].{{CiteNPC|npc=Ashuelot Reis|quote=I never saw him [the priest] again. He never gave us his true name, but as Nex was freed, she spoke to him... I heard little of what they said, but I did hear what she called him. Sliske.}}

Following these events, Nex quickly laid waste to vast numbers from all sides, but the four factions fighting for the [[Godsword]] temporarily formed an alliance and managed to imprison her again, though the magical protections that contained them could not be fully restored.{{CiteNPC|npc=Ashuelot Reis|quote=Nex posed such a danger, that the four armies temorarily joined forces to drive her back into the prison. They resealed it, but were unable to fix the enchantments we destroyed.}} Ashuelot, one of the first to die after Nex's escape, became a nature spirit, presumably as a result from the ritual, and became bound to the Ancient Prison.{{CiteNPC|npc=Ashuelot Reis|quote=I was one of the first to fall after Nex was freed, but I didn't truly die. Something about our ritual tied me to this place. I've been trapped here ever since. Not dead, but not really alive either.}}

During the [[Fifth Age]], an [[player character|adventurer]] reopened the [[frozen door]], unwittingly unsealing the Ancient Prison in the process. Ashuelot, realising that they have been tricked,{{CiteNPC|npc=Ashuelot Reis|quote=I fear you have been misled. There is no treasure here, only our great mistake.}} now aids those who'd be willing to keep Nex contained, by providing bank services before Nex's chambers.{{CiteNPC|npc=Ashuelot Reis|quote=If it helps, while my magic is limited here, I should still be able to transfer items in and out of the prison for you. Let me know if you'd like me to do this before you enter.}}

